import uniqid from 'uniqid'
const ProjectItems = [
    {
        id: uniqid(), name: 'Fresh Out',
        stack: "Ruby | Javascript | Heroku | HTML/CSS",
        info: "An app to help you track your food expiry to prevent ",
        img: require('./images/phone-screen-template.jpg')
    },
    {
        id: uniqid(),
        name: 'Japan Landmark',
        stack: "Ruby | Javascript | Heroku | HTML/CSS",
        info: "",
        img: require('./images/Japan_Landmarks.jpg')
    },
    {
        id: uniqid(),
        name: 'Memory Card',
        stack: "React | Javascript | Node | HTML/CSS",
        info: "",
        img: require('./images/Memory_Game.jpg')
    },
    {
        id: uniqid(),
        name: 'Farm BNB',
        stack: "Ruby | Javascript | Heroku | HTML/CSS",
        info: "",
        img: require('./images/farm-bnb.jpg')
    },
]

export default ProjectItems;
